@-moz-document domain("www.cakewalk.com"), domain("forum.cakewalk.com") {
  .altItem,
 .quote,
 .note,
.Admonition_Note_Text, .Admonition_Note_1_Text, .Admonition_Note_2_Text, .Admonition_Tip_Text, .Admonition_Caution_Text, .Admonition_Warning_Text, .Admonition_Remember_Text, .Admonition_Text_Continue, .Admonition_Text_Continue_Indent, .Admonition_Important_Text,
.feedback-box, tr.altItem td, td.altItem
{
     background: #464646 !important;
     color: white !important;
     background-color: #464646 !important;
 }
 .msg,
 .msgtable,
 body, .maintable .row, div.item, .small_wrapper, .forum_wrapper, .pagerPanel,
tr.item td, td.item, td:first-child, .content, #content-wrap, .text-center
{
     background: #262626 !important;
     color: white !important;
     background-color: #262626 !important;
 }
.messagelink, .maintable a, .msgSection a
{
    color: orange !important;
    text-shadow: none;
}
